import logo from './logo.svg';
import { Component } from 'react';
import './App.css';


class App extends Component{

 constructor(){
   super();

   this.state={
    mosters: [
       {
        name: 'Linda',
        id: Math.random(5)
      },
       {
       name: 'Bally',
       id: Math.random(5)
     },
     {
       name: 'Karen',
       id: Math.random(5)
     },
    ]

   }

 }



  render(){
    return (
      <div className="App">
       {this.state.mosters.map((monster) => {
         return  <h1 key={monster.id}>{monster.name}</h1>
       })}
      </div>
    );
  }

}

export default App;
